import{_ as o,o as i,c as s,z as t,a as e}from"./chunks/framework.9482e208.js";const v=JSON.parse('{"title":"§ 15.2-5521 Dissolution of authority; disposition of property.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/15.2-5521.md","filePath":"vacode/15.2-5521.md"}'),a={name:"vacode/15.2-5521.md"},r=t("h1",{id:"§-15-2-5521-dissolution-of-authority-disposition-of-property",tabindex:"-1"},[e("§ 15.2-5521 Dissolution of authority; disposition of property. "),t("a",{class:"header-anchor",href:"#§-15-2-5521-dissolution-of-authority-disposition-of-property","aria-label":'Permalink to "§ 15.2-5521 Dissolution of authority; disposition of property."'},"​")],-1),h=t("p",null,"Whenever the board of directors of the authority by resolution determines that the purposes for which the authority was formed have been substantially complied with, the then members of the board of directors of the authority shall thereupon execute and file for record with the governing body of the locality that created the authority, a resolution declaring such facts. If the governing body of the locality that created the authority is of the opinion that the facts stated in the authority's resolution are true and that the authority should be dissolved, it shall so resolve and the authority shall stand dissolved. Upon such dissolution, the title to all funds and properties owned by the authority at the time of such dissolution shall vest in the locality creating the authority and possession of such funds and properties shall forthwith be delivered to such locality.",-1),n=t("p",null,[e("2007, c. "),t("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?071+ful+CHAP0864",target:"_blank",rel:"noreferrer"},"864"),e(".")],-1),l=[r,h,n];function d(c,u,f,p,y,_){return i(),s("div",null,l)}const b=o(a,[["render",d]]);export{v as __pageData,b as default};
